import React, { Component } from "react";
import GenNavBar from "./navbar/GenNavBar";

import Grid from "@material-ui/core/Grid";
import HeaderContent from "./content/HeaderContent";
import MainContent from "./content/MainContent";
import FooterContent from "./content/FooterContent";
import "../../../../index.css";
import Paper from "@material-ui/core/Paper";

import Typography from "@material-ui/core/Typography";
import Link from "@material-ui/core/Link";
import HomeIcon from "./HomeIcon";

class HomePage extends Component {
  signInNav = () => {
    this.props.history.push("/signin");
  };

  signUpNav = () => {
    this.props.history.push("/signup");
  };

  render() {
    return (
      <div>
        <GenNavBar
          signInNav={this.signInNav}
          signUpNav={this.signUpNav}
        ></GenNavBar>

        <HeaderContent signUpNav={this.signUpNav}></HeaderContent>

        <MainContent signUpNav={this.signUpNav}></MainContent>

        <FooterContent signUpNav={this.signUpNav}></FooterContent>
      </div>
    );
  }
}

export default HomePage;
